import React from 'react';
import About from './About';
import CreateNew from './CreateNew';
import Creations from './Creations';
import Profile from './Profile';
import { Link } from "react-router-dom";
const Header = () => {
  return (
    <header>
    <div>
     <ul><li><Link to="/" className="nav-link">Home</Link></li><li><Link to="/About" className="nav-link">About</Link></li><li><Link to="/CreateNew" className="nav-link">Create New</Link></li><li><Link to="/Creations" className="nav-link">Creations</Link></li><li><Link to="/Profile" className="nav-link">Profile</Link></li></ul>
      </div>
    </header>
  );
};

export default Header;
